// Modify this to tweak the ratio between false positives and false negatives
const distanceThreshold = 0.3; 
// Step 1. - find all documents that score below the threshold
const allMatches = $input.all().filter(item => item.json.score < distanceThreshold);
// Step 2. - choose the one with the best score
return allMatches.length > 1 ? allMatches.reduce((min, item) => item.json.score < min.json.score ? item : min) : allMatches;
// AT THIS POINT ONLY ONE (OR ZERO) DOCUMENTS WOULD PASS
// 1 DOCUMENT - document with highest score, above the score threshold (cache hit)
// 0 DOCUMENTS - none of the documents are above the score threshold (cache miss)
